import React from 'react';

const HouseOfModels = () => {
  return (
    <div className="bg-black text-white py-16">
      <div className="max-w-7xl mx-auto px-4">
        {/* Image Grid */}
        <div className="grid grid-cols-3 gap-6 mb-16">
          {/* Individual Images */}
          {[
            "https://via.placeholder.com/300", // Replace with actual URLs
            "https://via.placeholder.com/300",
            "https://via.placeholder.com/300",
            "https://via.placeholder.com/300",
            "https://via.placeholder.com/300",
            "https://via.placeholder.com/300",
          ].map((src, index) => (
            <img
              key={index}
              src={src}
              alt={`Generated Model ${index + 1}`}
              className="rounded-lg object-cover w-full h-full"
            />
          ))}
        </div>

        {/* Description Section */}
        <div className="text-center">
          <p className="text-gray-400 uppercase tracking-wide mb-2">
            Generated Using
          </p>
          <h1 className="text-4xl font-bold mb-4">House of Models</h1>
          <p className="text-gray-300 text-lg max-w-2xl mx-auto mb-8">
            Over 250,000 images, videos, models, and descriptions have been
            generated by House of Models so far.
          </p>
          {/* Call-to-action Button */}
          <button className="bg-white text-black font-semibold py-2 px-6 rounded-lg hover:bg-gray-200">
            Talk to an expert
          </button>
        </div>
      </div>
    </div>
  );
};

export default HouseOfModels;
